import React from "react";

function Store(Props) {
    console.log(Props.Data[0].name);
    if (Props.filter.lenght) {
        return;
    }
    return (
        <div>
            {Props.Data.map((item, index) => {
                return <p key={index}>{item.name}</p>;
            })}
        </div>
    );
}

export default Store;
